import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: 'mon1',
        },
        {
          name: 'Frank',
          id: 'mon2',
        },
        {
          name: 'Jacky',
          id: 'mon3',
        },
        { name: 'James', id: 'mon4' },
      ],
    };
  }
  render() {
    return (
      <div className='App'>
        {this.state.monsters.map(monster => {
          return <h1 key={this.state.monsters.id}>{monster.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
